import React, { useEffect } from 'react';
//import { Link, withRouter } from 'react-router-dom';
import { getData } from '../actions/getNyc';
import { getGaurdian } from '../actions/getGaurdian';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import DataCard from './DataCard';

const DataView = ({ getNyc, getGaurdian, data }) => {
	useEffect(() => {
		getNyc(), getGaurdian();
	}, [getData, getGaurdian]);

	return <DataCard />;
};

DataView.propTypes = {
	DataView: PropTypes.func.isRequired,
	nycdata: PropTypes.array.isRequired,
	gaurdianData: PropTypes.array.isRequired
};
const mapStateToProps = state => ({
	nycData: state.nycData,
	gaurdianData: state.gaurdianData
});

export default connect(mapStateToProps, { getNyc, getGaurdian })(DataView);
